function protocolo(departamento, protocolo, vigencia, requerente, dataCriacao, servico){
    const { jsPDF } = window.jspdf;

    const doc = new jsPDF();

    const imgData = 'data:image/png;base64,'; // Coloque aqui o seu código base64
    doc.addImage(imgData, 'PNG', 10, 10, 70, 20);
    // Título
    doc.setFontSize(22);
    doc.setTextColor(0, 0, 128);
    doc.text('Protocolo de Atendimento', 20, 50);

// Linha separadora
    doc.setDrawColor(0, 0, 0);
    doc.line(10, 55, 200, 55);

// Informações do protocolo
    doc.setFontSize(12);
    doc.setTextColor(40, 40, 40);
    doc.text('Abertura: ' + dataCriacao.substring(1, dataCriacao.length - 1), 20, 65);
    doc.text('Número do Protocolo: ' + protocolo + '/' + vigencia, 20, 75);
    doc.text('Nome do Solicitante: ' + requerente.substring(1, requerente.length -1), 20, 85);

// Título da tabela
    doc.setFontSize(14);
    doc.setTextColor(0, 0, 128);
    doc.text('Informações do Protocolo', 20, 115);
    doc.line(20, 118, 190, 118);

// Cabeçalho da tabela
    doc.setFontSize(12);
    doc.setTextColor(0, 0, 0);
    doc.text('Campo', 20, 130);
    doc.text('Valor', 120, 130);
    doc.line(20, 133, 190, 133);

// Dados da tabela
    const fields = [
        { campo: 'Data:', valor: new Date().toLocaleDateString() },
        { campo: 'Nome do Requerente:', valor: requerente.substring(1, requerente.length -1) },
        { campo: 'Serviço Solicitado:', valor: servico.substring(1, servico.length -1) },
        { campo: 'Departamento Atual:', valor: departamento.substring(1, departamento.length - 1) }
    ];

// Adicionando dados na tabela
    fields.forEach((item, index) => {
        const yPosition = 140 + (index * 10);
        doc.text(item.campo, 20, yPosition);
        doc.text(item.valor, 120, yPosition);
    });

// Linha de separação na tabela
    doc.line(20, 140 + (fields.length * 10), 190, 140 + (fields.length * 10));

// Rodapé
    doc.setFontSize(12);
    doc.setTextColor(100, 100, 100);
    doc.text('Agradecemos o seu contato.', 20, 250);
    doc.text('Atenciosamente,', 20, 260);
    doc.text('Gestão de Processos', 20, 270);

// Salvar PDF
    doc.save(requerente.substring(1, requerente.length -1) + '.pdf');
}